import {ADD_ROUTE, LOGIN_ROUTE } from "../utils/const"
import {CART_ROUTE } from "../utils/const"

import { CHANGE_ROUTE } from "../utils/const"
import AddNewCart from "./AddNewCart"
import Cart from "./Cart"
import ChangeCart from "./ChangeCart"
import Login from "./Login"
export const publicRoutes = [
    {
        path: LOGIN_ROUTE,
        Component: Login
    },


    {
        path: CART_ROUTE,
        Component: Cart
    }
];
export const privateRoutes = [
    {
        path: ADD_ROUTE,
        Component: AddNewCart
    },

    {
        path: CHANGE_ROUTE,
        Component: ChangeCart
    }
];
